#=
function json_to_cheb2(input)
    obj = JSON3.read(input)
    coefs1 = Vector{Float64}[]
    coefs2 = Vector{Float64}[]
    range = Float64[]
    push!(range,obj[1][:xmin])
    for i in eachindex(obj)
        push!(coefs1,collect(obj[i][:coefL]))
        push!(coefs2,collect(obj[i][:coefV]))

        push!(range,obj[i][:xmax])
    end
    range_tuple = tuple(range...)
    data = ChebyshevBiRange(range_tuple,coefs1,coefs2)
    str = repr(data)
    str = replace(str,"]," => "],\n")
    str = replace(str,")," => "),\n")
    return str
end =#

